import React from "react";
import { useParams } from "react-router-dom";
import data from "../data/foodData.json";

const DetailPage = () => {
  const { status } = useParams();

  const filteredItems = data.filter(
    (item) => item["Consumption Status"] === status
  );

  return (
    <div style={{ padding: "20px" }}>
      <h2>Summary for: {status}</h2>
      <p>Total Items: {filteredItems.length}</p>
      <table border="1" cellPadding="8" style={{ marginTop: "1rem", width: "100%", borderCollapse: "collapse" }}>
        <thead>
          <tr>
            <th>Tray ID</th>
            <th>Food Item</th>
            <th>Meal Type</th>
            <th>Flight Route</th>
            <th>Passenger Age</th>
            <th>Weight (g)</th>
          </tr>
        </thead>
        <tbody>
          {filteredItems.map((item, idx) => (
            <tr key={idx}>
              <td>{item["Tray ID"]}</td>
              <td>{item["Food Item"]}</td>
              <td>{item["Meal Type"]}</td>
              <td>{item["Flight Route"]}</td>
              <td>{item["Passenger Age"]}</td>
              <td>{item["Weight (g)"]}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default DetailPage;
